import React from "react";

function Contact() {
    return (
        <>
            <label htmlFor="Email">Email:</label>
            <input type="text" id="Email" name="Email" />
            <label htmlFor="Message" id="message" name="message"/>
            <input type="text" id="Message" name="message"/>
        </>
    );
}

export default Contact;


